    false,nt"url": null,nt"notes": "Water levels and water quality parameters
    recorded on Crane Creek. Water-Data Report 2013 413723083123801 Crane Creek Mouth
    at Ottawa NWR LOCATION: Lat. 41u00b037'23"N, long 83u00b012'38"W, near Oak Harbor,
    OH. Ottawa County, OH, adjacent to management unit Pool 2B on Ottawa National Wildlife
    Refuge. DRAINAGE AREA: 35,688 acres SURFACE WATER RECORDS PERIOD OF RECORD: June
    2009 to present GAGE SITE: Design Analysis 522+ in communication with Esterline
    pressure transducer and YSI water quality probe in a square metal gage house. GOES
    antenna in communication with DA 522+ DCP transmits every hour in a 10 second window
    at a baud rate of 300. Instruments are powered by a 1.2 ampere solar panel run to
    a deep cycle marine battery through a Sunsaver power regulator. Solar panel , GPS
    and GOES antennas are attached to a mast connected to the gage house. Stage is collected
    at 15-minute intervals. Weekly gage height data available online, NWS Id is CRR01.
    Datum of the gage is the International Great Lakes Datum of 1985. NATIONAL WILDLIFE
    REFUGE: Ottawa NWR COOPERATION: USGS Great Lakes Science Center REMARKS: Records
    coded fair for the 2013 calendar year. EXTREMES FOR THE PERIOD OF RECORD: Maximum
    gage height, 574.17 ft, October 19, 2011; minimum gage height, 569.46 ft, October
    28, 2010. EXTREMES FOR CURRENT YEAR: Maximum gage height, 573.07 ft, April 11; minimum
    gage height, 570.04 ft, January 20.",nt"license_title": "License Not Specified",nt"extras":
